-- ============================================================
-- DATABASE 4: BANKING & FINANCE SYSTEM (NexBank)
-- Tables: branches, customers, accounts, account_nominees,
--         transactions, loans, loan_repayments, credit_cards,
--         credit_card_transactions, fixed_deposits, recurring_deposits,
--         kyc_documents, beneficiaries, cheques, atm_withdrawals,
--         fraud_alerts, interest_rates
-- ============================================================

CREATE DATABASE IF NOT EXISTS nexbank_finance;
USE nexbank_finance;

CREATE TABLE branches (
  branch_id INT PRIMARY KEY AUTO_INCREMENT,
  branch_name VARCHAR(200) NOT NULL,
  branch_code VARCHAR(20) UNIQUE,
  ifsc_code VARCHAR(20) UNIQUE,
  address TEXT,
  city VARCHAR(100),
  state VARCHAR(100),
  pincode VARCHAR(10),
  phone VARCHAR(20),
  manager_name VARCHAR(100),
  established_date DATE,
  is_active BOOLEAN DEFAULT TRUE
);


CREATE TABLE customers (
  customer_id INT PRIMARY KEY AUTO_INCREMENT,
  branch_id INT NOT NULL,
  customer_number VARCHAR(20) UNIQUE,
  first_name VARCHAR(50) NOT NULL,
  last_name VARCHAR(50) NOT NULL,
  email VARCHAR(100) UNIQUE,
  phone VARCHAR(20),
  gender ENUM('Male','Female','Other'),
  date_of_birth DATE,
  pan_number VARCHAR(10) UNIQUE,
  aadhar_number VARCHAR(12),
  address TEXT,
  city VARCHAR(100),
  occupation ENUM('Salaried','Self-employed','Business','Student','Retired','Homemaker'),
  annual_income DECIMAL(12,2),
  customer_since DATE,
  is_active BOOLEAN DEFAULT TRUE,
  FOREIGN KEY (branch_id) REFERENCES branches(branch_id)
);


CREATE TABLE accounts (
  account_id INT PRIMARY KEY AUTO_INCREMENT,
  customer_id INT NOT NULL,
  branch_id INT NOT NULL,
  account_number VARCHAR(20) UNIQUE,
  account_type ENUM('Savings','Current','Salary','NRI','Joint'),
  balance DECIMAL(15,2) DEFAULT 0,
  minimum_balance DECIMAL(10,2) DEFAULT 0,
  interest_rate DECIMAL(5,2) DEFAULT 0,
  opened_date DATE,
  status ENUM('Active','Dormant','Frozen','Closed'),
  nominee_name VARCHAR(100),
  FOREIGN KEY (customer_id) REFERENCES customers(customer_id),
  FOREIGN KEY (branch_id) REFERENCES branches(branch_id)
);


CREATE TABLE transactions (
  transaction_id INT PRIMARY KEY AUTO_INCREMENT,
  account_id INT NOT NULL,
  transaction_date DATETIME,
  transaction_type ENUM('Credit','Debit'),
  amount DECIMAL(12,2),
  balance_after DECIMAL(12,2),
  channel ENUM('ATM','Branch','Net Banking','Mobile','UPI','NEFT','RTGS','IMPS','Cheque'),
  description VARCHAR(300),
  reference_number VARCHAR(50),
  status ENUM('Success','Failed','Reversed','Pending'),
  FOREIGN KEY (account_id) REFERENCES accounts(account_id)
);


CREATE TABLE loans (
  loan_id INT PRIMARY KEY AUTO_INCREMENT,
  customer_id INT NOT NULL,
  account_id INT,
  loan_type ENUM('Home','Car','Personal','Education','Business','Gold','Mortgage'),
  principal_amount DECIMAL(12,2),
  interest_rate DECIMAL(5,2),
  tenure_months INT,
  emi_amount DECIMAL(10,2),
  disbursement_date DATE,
  first_emi_date DATE,
  status ENUM('Applied','Approved','Rejected','Disbursed','Active','Closed','NPA'),
  outstanding_balance DECIMAL(12,2),
  FOREIGN KEY (customer_id) REFERENCES customers(customer_id)
);


CREATE TABLE credit_cards (
  card_id INT PRIMARY KEY AUTO_INCREMENT,
  customer_id INT NOT NULL,
  card_number VARCHAR(20) UNIQUE,
  card_type ENUM('Visa','Mastercard','RuPay','Amex'),
  card_variant ENUM('Classic','Gold','Platinum','Signature','Infinite'),
  credit_limit DECIMAL(10,2),
  available_credit DECIMAL(10,2),
  outstanding_balance DECIMAL(10,2),
  billing_date INT,
  due_date INT,
  issue_date DATE,
  expiry_date DATE,
  status ENUM('Active','Blocked','Expired','Cancelled'),
  FOREIGN KEY (customer_id) REFERENCES customers(customer_id)
);


CREATE TABLE fixed_deposits (
  fd_id INT PRIMARY KEY AUTO_INCREMENT,
  customer_id INT NOT NULL,
  account_id INT,
  fd_number VARCHAR(20) UNIQUE,
  principal_amount DECIMAL(12,2),
  interest_rate DECIMAL(5,2),
  tenure_days INT,
  start_date DATE,
  maturity_date DATE,
  maturity_amount DECIMAL(12,2),
  interest_payout ENUM('Monthly','Quarterly','Annual','On Maturity'),
  status ENUM('Active','Matured','Closed','Prematurely Withdrawn'),
  FOREIGN KEY (customer_id) REFERENCES customers(customer_id)
);


CREATE TABLE fraud_alerts (
  alert_id INT PRIMARY KEY AUTO_INCREMENT,
  account_id INT,
  transaction_id INT,
  alert_type ENUM('Unusual Location','High Amount','Multiple Attempts','Suspicious Merchant','Card Skimming'),
  risk_level ENUM('Low','Medium','High','Critical'),
  alert_date DATETIME,
  description TEXT,
  status ENUM('Open','Investigating','Resolved','False Positive'),
  resolved_date DATE,
  FOREIGN KEY (account_id) REFERENCES accounts(account_id)
);


CREATE TABLE interest_rates (
  rate_id INT PRIMARY KEY AUTO_INCREMENT,
  product_type ENUM('Savings Account','Fixed Deposit','Recurring Deposit','Home Loan','Car Loan','Personal Loan','Education Loan'),
  tenure_description VARCHAR(100),
  min_tenure_days INT,
  max_tenure_days INT,
  interest_rate DECIMAL(5,2),
  effective_from DATE,
  effective_till DATE,
  is_current BOOLEAN DEFAULT TRUE
);

